function [fitresult, gof] = fit_ny(p, T, ny)
%CREATEFIT(P,T,NY)
%  Create a fit.
%
%  Data for 'ny(p,T)' fit:
%      X Input: p
%      Y Input: T
%      Z Output: ny
%  Output:
%      fitresult : a fit object representing the fit.
%      gof : structure with goodness-of fit info.
%
%  See also FIT, CFIT, SFIT.

%  Auto-generated by MATLAB on 29-Mar-2023 13:06:58


%% Fit: 'ny(p,T)'.
[xData, yData, zData] = prepareSurfaceData( p, T, ny );

% Set up fittype and options.
ft = 'linearinterp';
opts = fitoptions( 'Method', 'LinearInterpolant' );
opts.ExtrapolationMethod = 'linear';
opts.Normalize = 'on';

% Fit model to data.
[fitresult, gof] = fit( [xData, yData], zData, ft, opts );

% Plot fit with data.
figure( 'Name', 'ny(p,T)' );
h = plot( fitresult, [xData, yData], zData );
legend( h, 'ny(p,T)', 'ny vs. p, T', 'Location', 'NorthEast', 'Interpreter', 'none' );
% Label axes
xlabel( 'p', 'Interpreter', 'none' );
ylabel( 'T', 'Interpreter', 'none' );
zlabel( 'ny', 'Interpreter', 'none' );
grid on
view( -43.4, 23.6 );


